import React, { useState, useEffect } from "react";
import axios from "../axiosConfig";

const DishTable = () => {
  const [dishes, setDishes] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const [currentPage, setCurrentPage] = useState(1);
  const [searchTerm, setSearchTerm] = useState("");
  const [sortConfig, setSortConfig] = useState({
    key: "name",
    direction: "asc",
  });
  const itemsPerPage = 10;

  // Fetch data when component mounts or dependencies change
  useEffect(() => {
    fetchDishes();
  }, [currentPage, searchTerm, sortConfig]);

  const fetchDishes = async () => {
    setLoading(true);
    setError(null);
    try {
      const response = await axios.get("/dishes", {
        params: {
          page: currentPage,
          limit: itemsPerPage,
          search: searchTerm,
          sort_by: sortConfig.key,
          order: sortConfig.direction,
        },
      });
      setDishes(response.data);
    } catch (err) {
      setError("Failed to fetch dishes");
    } finally {
      setLoading(false);
    }
  };

  // Handle sorting
  const handleSort = (key) => {
    setSortConfig((prevConfig) => ({
      key,
      direction:
        prevConfig.key === key && prevConfig.direction === "asc"
          ? "desc"
          : "asc",
    }));
  };

  // Handle search input change
  const handleSearchChange = (event) => {
    setSearchTerm(event.target.value);
    setCurrentPage(1); // Reset to first page on search
  };

  // Handle page change
  const handlePageChange = (newPage) => {
    setCurrentPage(newPage);
  };

  return (
    <div>
      <input
        type="text"
        placeholder="Search dishes..."
        value={searchTerm}
        onChange={handleSearchChange}
      />
      {loading ? (
        <p>Loading...</p>
      ) : error ? (
        <p>{error}</p>
      ) : (
        <table>
          <thead>
            <tr>
              <th onClick={() => handleSort("name")}>Dish Name</th>
              <th onClick={() => handleSort("prepTime")}>Preparation Time</th>
              <th onClick={() => handleSort("cookTime")}>Cooking Time</th>
              <th onClick={() => handleSort("diet")}>Diet</th>
              <th onClick={() => handleSort("flavor")}>Flavor</th>
              <th onClick={() => handleSort("state")}>State</th>
            </tr>
          </thead>
          <tbody>
            {console.log("dishes >> ", dishes.results)}
            {dishes &&
              dishes.results &&
              dishes.results.map((dish) => (
                <tr key={dish.id}>
                  <td>{dish.name}</td>
                  <td>{dish.prepTime}</td>
                  <td>{dish.cookTime}</td>
                  <td>{dish.diet}</td>
                  <td>{dish.flavor}</td>
                  <td>{dish.state}</td>
                </tr>
              ))}
          </tbody>
        </table>
      )}
      <div>
        {/* Pagination controls */}
        <button
          onClick={() => handlePageChange(currentPage - 1)}
          disabled={currentPage === 1}
        >
          Previous
        </button>
        <span>Page {currentPage}</span>
        <button
          onClick={() => handlePageChange(currentPage + 1)}
          disabled={dishes.length < itemsPerPage}
        >
          Next
        </button>
      </div>
    </div>
  );
};

export default DishTable;
